import React from "react";
import "./App.css";
// import Navbar from "./Navbar";
//import Footer from "./Footer";
//import Contact from "./Contact";
//import WriteRecommendation from "./WriteRecommendation";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import PastEventPage from "./PastEventPage";
import HomePage from "./HomePage";
import NotFound from "./NotFound";
import FutureEventPage from "./FutureEventPage";
import AddPastEvent from "./AddPastEvent";
import AddFutureEvent from "./AddFutureEvent";
import { Provider } from "./context";
import AllPastEvents from "./AllPastEvents";
import AllFutureEvents from "./AllFutureEvents";
import ScrollToTop from "./ScrollToTop";
import Test from "./Test";


function App() {
  return (
    <Provider>
      <BrowserRouter>
        <ScrollToTop />

        <Switch>
          <Route exact path="/" component={HomePage}
           />
          <Route exact path="/allpastevents" component={AllPastEvents} />
          <Route exact path="/allfutureevents" component={AllFutureEvents} />
          <Route exact path="/pastevent/add" component={AddPastEvent} />
          <Route exact path="/futureevent/add" component={AddFutureEvent} />
          <Route exact path="/pastevent/:id" component={PastEventPage} />
          <Route exact path="/futureevent/:id" component={FutureEventPage} />
          <Route exact path="/test" component={Test}
           />
          <Route component={NotFound} />
          <Route  //exact path="/contact" component={Contact}
           />
          <Route
             //exact
             //path="/write-a-recommendation"
             //component={WriteRecommendation}
          />
        </Switch>

      </BrowserRouter>
    </Provider>
  );
}

export default App;
